import React from "react";

function Scoreboard({ attempts }) {
  return (
    <div>
      <h3>Scoreboard</h3>
      <ul>
        {attempts.map((attempt, index) => (
          <li key={index}>{attempt.date} - Score: {attempt.score}</li>
        ))}
      </ul>
    </div>
  );
}

export default Scoreboard;
